(window.webpackJsonp=window.webpackJsonp||[]).push([[18],{268:function(n){n.exports={data:{tag:{title:"resume",belongsTo:{edges:[{node:{title:"My Resume",path:"/my-resume",date:"19. July 2019",timeToRead:2,description:"About Me.",coverImage:null,content:'<head> \n    <script defer src="https://use.fontawesome.com/releases/v5.11.2/js/all.js"><\/script> \n    <script defer src="https://use.fontawesome.com/releases/v5.11.2/js/v4-shims.js"><\/script> \n</head> \n<link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.11.2/css/all.css">\n<center>\n       <h3>\n           唐一鸣 🥇 测试开发 / 自动化测试 / 性能测试\n       </h3>\n       <div>\n           <span>\n               <i class="fas fa-mobile-alt"></i> 18724026847\n           </span>\n           <span>\n               <i class="far fa-envelope"></i> backtym@live.cn\n           </span>\n           <span>\n               <i class="fab fa-github"></i> <a href="https://Github.com/Tangyiming">Github</a>\n           </span>\n           <span>\n               <i class="fas fa-blog"></i> <a href="https://eperf.top/">Blog</a>\n           </span>\n       </div>\n </center>\n<h2 id="i-classfab-fa-mailchimpi-个人信息"><a href="#i-classfab-fa-mailchimpi-%E4%B8%AA%E4%BA%BA%E4%BF%A1%E6%81%AF" aria-hidden="true"><span class="icon icon-link"></span></a><i class="fab fa-mailchimp"></i> 个人信息</h2>\n<ul>\n<li>男，1991 年出生</li>\n<li>已婚</li>\n<li>家乡南京，现居上海</li>\n<li>工作经验：2015.06 ~ 至今</li>\n</ul>\n<h2 id="i-classfas-fa-dnai-自我评价"><a href="#i-classfas-fa-dnai-%E8%87%AA%E6%88%91%E8%AF%84%E4%BB%B7" aria-hidden="true"><span class="icon icon-link"></span></a><i class="fas fa-dna"></i> 自我评价</h2>\n<ul>\n<li>拥有优秀的沟通与学习能力</li>\n<li>具有职业创业精神和仔细认真踏实的工作作风</li>\n<li>拥有择一事而终老的踏实不浮躁的品质</li>\n</ul>\n<h2 id="i-classfas-fa-toolsi-技能清单"><a href="#i-classfas-fa-toolsi-%E6%8A%80%E8%83%BD%E6%B8%85%E5%8D%95" aria-hidden="true"><span class="icon icon-link"></span></a><i class="fas fa-tools"></i> 技能清单</h2>\n<ul>\n<li>Python / Flask</li>\n<li>Java / Springboot</li>\n<li>JavaScript / Vue.js</li>\n<li>Jmeter / Jenkins / Docker / Ansible / Nginx / Splunk</li>\n</ul>\n<h2 id="i-classfas-fa-graduation-capi-教育经历"><a href="#i-classfas-fa-graduation-capi-%E6%95%99%E8%82%B2%E7%BB%8F%E5%8E%86" aria-hidden="true"><span class="icon icon-link"></span></a><i class="fas fa-graduation-cap"></i> 教育经历</h2>\n<ul>\n<li>2011.9 ~ 2015.7 曲阜师范大学 信息与计算科学专业 学士学位</li>\n<li>英语等级 CET6</li>\n</ul>\n<h2 id="i-classfas-fa-codei-工作经历"><a href="#i-classfas-fa-codei-%E5%B7%A5%E4%BD%9C%E7%BB%8F%E5%8E%86" aria-hidden="true"><span class="icon icon-link"></span></a><i class="fas fa-code"></i> 工作经历</h2>\n<ul>\n<li>\n<p><strong>2019.07 ~ Now Allegis Group - Contract of Splunk Performance Engineer</strong></p>\n<p>1）Enhance freaky cases which test results is unstable</p>\n<pre class="language-text">18 cases that has too short search time\n\n6 cases that the search commands itself unstable\n\n1 case that baseline is inaccurate (transaction_test)\n\n3 case that anchors/symbols in test data is random</pre>\n<p>2）Cover customer case into search cases </p>\n<pre class="language-text">Real time search memory leak when bundle replicate</pre>\n<p>3）Other</p>\n<pre class="language-text">Daily triage \n\nUpdate urls of app add-ons in search cases\n\nTimeout solution to hung cases \n\nComparison of orca0.8+Debian8 and orca1.0.1+RHEL8\n\nList cases which needed migrating to orca 1.0 Tests’ performance comparison\n\nMake rules to assess the resource KPI\n\nDetach ES app from exist test cases to reduce potential impact due to python compatibility</pre>\n<p>Main Key Result:</p>\n<pre class="language-text">Reduce the freaky cases number by 90%\n\nAdd new qualified perf cases\n\nReduce time to triage by 90% via stabilizing case and automating reproducing issues.</pre>\n</li>\n</ul>\n  \x3c!-- - **2019.05 ~ 2019.07 上海掌小门教育科技有限公司 运营系统研发部**\n\n    主要工作内容：业务测试、性能测试，自动化测试平台的规划设计与搭建\n\n    1）业务测试\n\n    拼团活动，六一少儿思维挑战赛与营销系统管理后台少儿激励值体系部分。\n\n    2）性能测试\n\n    M站报名页注册预约接口与高考估分活动获取二维码接口压测。\n\n    3）自动化测试平台的规划设计与搭建\n\n    平台化前端与服务端性能测试与工具集等 --\x3e\n<ul>\n<li>\n<p><strong>2017.06 ~ 2019.05  红星美凯龙悦家互联网科技有限公司  质量管理部  测试开发工程师</strong></p>\n<p>🏆2018 年度集团先进员工（ 每个部门一个 ）</p>\n<p>主要工作内容：接口测试、性能测试、H5 开发、测试方案落地推广与培训</p>\n<p>1）接口测试</p>\n<pre class="language-text">基于 SpringBoot+Maven+testng+restAssured+extentReport 对重要业务场景的接口和最多被调用到的接口进行接口测试（单接口调用，场景化多接口串联调用）。了解接口业务场景，设计测试用例，编写测试脚本，执行测试用例，联系研发修复问题，配置 Jenkins Job（拉仓库脚本，Maven 执行测试，生成报告），集成持续交付系统，在以后项目每次发版部署后自动执行测试用例生成报告，维护用例与测试脚本。</pre>\n<p>2）性能测试（ 后端接口 / 前端 H5 页 ）</p>\n<pre class="language-text">后端使用 Jmeter 工具与自研的性能测试平台进行定制化场景压测与单接口性能测试。其中参与需求调研、场景定制、数据准备、Jmeter 脚本开发、测试执行、性能诊断、性能调优（ 与开发一起进行 ），发布测试报告整个流程的工作。18 年全年共压测 120+次，覆盖互联网集团基础应用（ 短信平台，统一登陆 ），龙眼（ 代办中心 ），龙翼龙果（ 商品中心，开单管理，交易 ），智慧商场（ 人脸识别 ），内部流程管理系统，大数据平台（ 战报系统 ）、企划（ 大牌天团活动 ），APP 等业务线，精准发现容量的瓶颈，发现问题 10+,有效保障了“32 周年庆”、“两天来了”、“五一”、“双十一”等大促活动的成功举办。\n\n前端 H5 页面测试由我一人独立调研并基于 Sitespeed（ Docker ）开源框架二次开发搭建前端性能测试平台投入公司的线上项目使用，数据存储使用 influxDB 与 MySQL，后端使用 Python/Flask，前端使用 React，自动化构建测试使用了 Jenkins，服务器使用 Centos7，并与持续交付系统对接。</pre>\n<p>3）前端 H5 开发</p>\n<pre class="language-text">负责部门内部使用的 App 管理平台、消费指数平台、性能测试平台，质量门平台的前端开发工作和持续交付平台，研发效能平台的维护工作；\n\nApp 管理平台、消费指数平台和性能测试平台使用 React+AntD+AntV 开发，质量门平台，持续交付平台与研发效能平台使用 Vue+Element+echarts 等进行开发与维护。</pre>\n</li>\n</ul>\n<ul>\n<li>\n<p><strong>2016.11 ~ 2017.06  南京步锐捷科技有限公司外派江苏润和软件股份有限公司  自动化测试</strong></p>\n<p>🏆在职期间受到经理多次公开表扬表示对我工作的肯定，离职时加薪挽留。</p>\n<p>主要对 Rokid 语音智能家居机器人进行自动化测试工作</p>\n<p>1）编写基于框架 UiAutomator 的 Python 自动化测试脚本；</p>\n<p>2）编写需要的工具（ JavaFX 窗口工具，Python 脚本工具，Shell 脚本工具，Apk 工具 ）；</p>\n<p>3）进行内存泄漏测试，AT 命令收发测试（ 编写 AT 收发测试工具 ），API 接口测试，CTS 测试等。</p>\n<p>4）部分测试用例编写与功能测试。</p>\n</li>\n</ul>\n<ul>\n<li>\n<p><strong>2015.06 ~ 2016.10  南京秉谦信息科技有限公司  Java Web 开发</strong></p>\n<p>主要工作内容：</p>\n<p>1）修复系统 Bug,处理测试反馈的问题，主要有系统功能的问题，有 SQL 语句的问题。</p>\n<p>2）开发各高校系统定制需求个性化功能模块。</p>\n<p>3）维护系统数据库信息（ Oracle SQL ）。</p>\n<p>4）远程服务器系统部署实施。</p>\n</li>\n</ul>\n'}}]}}}}}}]);